import Vue from "vue";
import Router from "vue-router";
import HelloWorld from "./HelloWorld.vue";
import login from "./login.vue";

Vue.use(Router);

export default new Router({
    routes:[
        {path:"", component:HelloWorld},
        {path:"/login", component:login},
    ],
});
